INSERT INTO `biz_article` VALUES (3,'成功发第一篇博客之前我经历了啥',1,'http://106.13.33.147/pic/oneblog/20201211152331004.jpg',NULL,0,'<p><font size=\"4\">之前因为搭建博客需要redis，所以在百度的云服务里装了redis，但是当时随便设置了一个redis密码123456，然后就出问题了。</font></p><p><font size=\"4\">当时访问博客的时候感觉巨卡，而且终端连接也很卡，于是我就到百度云服务的后台看了一下服务器的状态，发现服务器的的CPU,内存</font></p><p><font size=\"4\">占用都在100%，然后使用了命令（<a href=\"https://www.cnblogs.com/sparkbj/p/6148817.html\" target=\"_blank\">链接：Linux下查看哪些进程占用的CPU内存资源</a>）</font></p><pre><code>top -d 刷新时间</code></pre><p><font size=\"4\">发现有个两个进程疯狂消耗资源，使用命令（<a href=\"https://www.runoob.com/linux/linux-comm-kill.html\" target=\"_blank\">链接：kill命令</a>）</font><br></p><pre><code>kill -9 pid</code></pre><p><font size=\"4\">也没法把这两进程杀掉，然后百度了一下，感觉就是redis被暴力破解了，然后给我植入了挖矿程序<span>?真的可恶啊</span></font></p><p><font size=\"4\"><span>然后我就简单粗暴的回滚了之前的镜像</span></font></p><p><font size=\"4\"><span>首先把redis密码改复杂了</span></font></p><p><font size=\"4\"><span>然后把博客的jar包跑起来了（<a href=\"https://www.cnblogs.com/baby123/p/6477429.html\" target=\"_blank\">链接：nohup后台运行及结束运行</a>）<br></span></font></p><pre><code>nohup java -jar jar包名 &gt; 日志输出文件名 2&gt;&amp;1&amp;</code></pre><p><font size=\"4\">当我重新访问博客时才想起来，数据库的数据是保存镜像的时候的数据，我辛辛苦苦码的字都没了</font></p><p><font size=\"4\">接着我就在考虑数据库备份问题了，使用这些命令备份数据（<a href=\"https://www.cnblogs.com/markLogZhu/p/11398028.html\" target=\"_blank\">链接：mysqldump的使用</a>）<br></font></p><pre><code>rm -rf /root/myBlog/backup/dblog_backup.sql<br>/usr/local/mysql/bin/mysqldump -u数据库用户名 -p数据库密码 数据库名 &gt; /root/myBlog/backup/dblog_backup.sql</code></pre><p><font size=\"4\">然后把命令封装成shell脚本，使用（<a href=\"https://www.linuxprobe.com/how-to-crontab.html\" target=\"_blank\">Linux Crontab 定时任务</a>）</font></p><pre><code>crontab -e</code></pre><p><font size=\"4\">配置每天执行一次该执行这个脚本</font></p><div><img src=\"http://106.13.33.147/oneblog/20201211150207091.jpg\" alt=\"\" style=\"max-width: 100%;height: auto;border-radius: 6px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br></div><div><font size=\"4\"><br></font></div><div><font size=\"4\">为了更安全其实还可以写个脚本将备份push到git远程仓库，然后定时执行</font><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>',NULL,1,3,1,0,1,'个人博客，Linux，数据库备份，redis密码','个人博客，Linux，数据库备份，redis密码',1,'2020-12-11 11:31:40','2020-12-23 09:57:01'),(4,'深入浅出synchronized',1,'',NULL,0,'<p>\n</p><h6>偏向锁</h6><p>\n</p><h6>轻量级锁</h6><p>\n</p><h6>重量级锁</h6>\n\n\n\n\n\n',NULL,0,2,0,0,1,'锁','锁',0,'2020-12-22 16:19:21','2020-12-22 16:19:21'),(5,'java中一个对象的创建过程（jvm中发生了啥）',1,'',NULL,0,'<p>当我们在代码中new一个对象时，jvm在这个过程中做了什么呢？接下来我就简单描述一下</p><p>1.当jvm知道我们要new一个对象以后，会检查这个对象的类是否加载，如果没有，那必须先执行相应的类加载过程</p><p>2.在类加载检查通过后，接下来虚拟机将为新生对象分配内存。对象所需内存的大小在类加载完成后便可完全确定</p><p>3.内存分配完成之后，虚拟机必须将分配到的内存空间(但不包括对象头)都初始化为零值</p><p>4.接下来，Java虛拟机还要对对象进行必要的设置，例如这个对象是哪个类的实例、如何才能找到类的元数据信息、对象的哈希码(实际上对象的哈希码会延后到真正调用0bject::hashCode()方法时才计算) 、对象的GC分代年龄等信息。这些信息存放在对象的对象头(Object Header) 之中。根据虚拟机当前运行状态的不同，如是否启用偏向等，对象头会有不同的设置方式。</p><p>5.在上面工作都完成之后，从虚拟机的视角来看，一个新的对象已经产生了。但是从Java程序的视角看来，对象创建才刚刚开始一构造函数， 即Class文件中的&lt;init&gt; ()方法还没有执行，所有的字段都为默认的零值，对象需要的其他资源和状态信息也还没有按照预定的意图构造好。-般来说(由字节码流中new指令后面是否跟随invokespecial指令所决定，Java编译器会在遇到new关键字的地方同时生成这两条字节码指令，但如果直接通过其他方式产生的则不一定如此)new指令之后会接着执行&lt;init&gt; (方法，按照程序员的意愿对对象进行初始化，这样一个真正可用的对象才算完全被构造出来。</p>',NULL,0,2,1,0,1,'对象创建','对象创建',1,'2020-12-22 16:55:47','2020-12-22 17:02:15'),(6,'jvm运行时数据区',1,'http://106.13.33.147/pic/oneblog/20201223103214367.png',NULL,0,'<p><br></p><div><img src=\"http://106.13.33.147/pic/oneblog/20201223103214367.png\" alt=\"\" style=\"max-width: 100%;height: auto;border-radius: 6px;\">&nbsp; <br></div><p>\n</p><p><span style=\"font-weight: bold;\">1.程序计数器</span></p><p>程序计数器(Program Counter Register)是-块较小的内存空间，它可以<br>看作是当前线程所执行的字节码的行号指示器。在Java虚拟机的概念模型里[1],<br>字节码解释器工作时就是通过改变这个计数器的值来选取下一条需要执行的字节<br>码指令，它是程序控制流的指示器，分支、循环、跳转、异常处理、线程恢复等<br>基础功能都需要依赖这个计数器来完成。<br>由于Java虚拟机的多线程是通过线程轮流切换、分配处理器执行时间的方式<br>来实现的，在任何一一个确定的时刻，-个处理器(对于多核处理器来说是一个内<br>核)都只会执行一 条线程中的指令。因此，为了线程切换后能恢复到正确的执行<br>位置，每条线程都需要有一个独立的程序计数器，各条线程之间计数器互不影<br>响，独立存储，我们称这类内存区域为“线程私有”的内存。<br>如果线程正在执行的是一个Java方法， 这个计数器记录的是正在执行的虚拟<br>机字节码指令的地址;如果正在执行的是本地(Native) 方法，这个计数器值则<br>应为空(Undefined) 。</p><p><span style=\"font-weight: bold;\">2.java虚拟机栈</span></p><p>与程序计数器一样， Java虛拟机栈(Java Virtual Machine Stack)也是线程<br>私有的，它的生命周期与线程相同。虚拟机栈描述的是Java方法执行的线程内存<br>模型:每个方法被执行的时候，Java虚拟机都会同步创建一 个栈帧1] (Stack<br>Frame) 用于存储局部变量表、操作数栈、动态连接、方法出口等信息。每一个<br>方法被调用直至执行完毕的过程，就对应着一个栈帧在虚拟机栈中从入栈到出栈<br>的过程。</p><p><span style=\"font-weight: bold;\"></span></p><p><span style=\"font-weight: bold;\">3.本地方法栈</span></p><p>本地方法栈(Native Method Stacks)与虚拟机栈所发挥的作用是非常相似<br>的，其区别只是虚拟机栈为虚拟机执行Java方法(也就是字节码)服务，而本地<br>方法栈则是为虚拟机使用到的本地(Native) 方法服务。</p><p><span style=\"font-weight: bold;\"></span></p><p><span style=\"font-weight: bold;\">4.java堆</span></p><p>对于Java应用程序来说，Java堆(Java Heap)是虚拟机所管理的内存中最<br>大的一块。Java堆 是被所有线程共享的一块内存区域，在虚拟机启动时创建。此<br>内存区域的唯一目的就是存放对象实例， Java世界里“几乎”所有的对象实例都<br>在这里分配内存。</p><p><span style=\"font-weight: bold;\"></span></p><p><span style=\"font-weight: bold;\">5.方法区</span></p><p>方法区(Method Area)与Java堆一 样，是各个线程共享的内存区域，它用<br>于存储已被虚拟机加载的类型信息、常量、静态变量、即时编译器编译后的代码<br>缓存等数据。</p><p><span style=\"font-weight: bold;\">6.运行时常量池</span></p><p>运行时常量池(Runtime Constant Pool)是方法区的一部分。Class文件中<br>除了有类的版本、字段、方法、接口等描述信息外，还有一项信息是常量池表<br>(Constant Pool Table)，用于存放编译期生成的各种字面量与符号引用，这部<br>分内容将在类加载后存放到方法区的运行时常量池中。</p>\n\n',NULL,0,2,1,0,1,'jvm运行时数据区','jvm运行时数据区',1,'2020-12-23 10:54:47','2020-12-28 14:03:09'),(7,'判断对象是否存活',1,'',NULL,0,'<p><span style=\"font-weight: bold;\">1.引用计数算法</span></p><p><br></p><p><span style=\"font-weight: bold;\">2.可达性分析算法</span><br></p>',NULL,0,2,0,0,1,'判断对象存活','判断对象存活',0,'2020-12-23 17:12:07','2020-12-23 17:12:07'),(8,'java对引用概念的扩充',1,'',NULL,0,'<p><span style=\"font-weight: bold;\">1.强引用</span></p><p><span style=\"font-weight: bold;\"><br></span></p><p><span style=\"font-weight: bold;\">2.软引用</span></p><p><span style=\"font-weight: bold;\"><br></span></p><p><span style=\"font-weight: bold;\">3.弱引用</span></p><p><span style=\"font-weight: bold;\"><br></span></p><p><span style=\"font-weight: bold;\">4.虚引用</span></p><p><span style=\"font-weight: bold;\"></span><br></p>',NULL,0,4,0,0,1,'引用','引用',0,'2020-12-23 17:15:55','2020-12-23 17:15:55');
