1,1,'SYSTEM','INFO','用户: [root] | 操作: 发布文章','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8085/article/save','http://106.13.33.147:8085/article/publish','2020-12-22 16:55:47','2020-12-22 16:55:47'),(502,1,'SYSTEM','INFO','用户: [root] | 操作: 进入文章列表页','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8085/articles','http://106.13.33.147:8085/article/publish','2020-12-22 16:55:51','2020-12-22 16:55:51'),(503,NULL,'VISIT','INFO','访客: [124.74.76.126] | 操作: 进入首页','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8443/',NULL,'2020-12-22 17:00:32','2020-12-22 17:00:32'),(504,NULL,'VISIT','INFO','访客: [124.74.76.126] | 操作: 进入文章[5]详情页','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8443/article/5','http://106.13.33.147:8085/articles','2020-12-22 17:01:24','2020-12-22 17:01:24'),(505,1,'SYSTEM','INFO','用户: [root] | 操作: 进入修改文章页[id=5]','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8085/article/update/5','http://106.13.33.147:8085/articles','2020-12-22 17:01:35','2020-12-22 17:01:35'),(506,1,'SYSTEM','INFO','用户: [root] | 操作: 获取文章[5]详情','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8085/article/get/5','http://106.13.33.147:8085/article/update/5','2020-12-22 17:01:39','2020-12-22 17:01:39'),(507,1,'SYSTEM','INFO','用户: [root] | 操作: 发布文章','{\"isMarkdown\":[\"false\"],\"id\":[\"5\"],\"title\":[\"java中一个对象的创建过程（jvm中发生了啥）\"],\"original\":[\"on\"],\"content\":[\"<p>当我们在代码中new一个对象时，jvm在这个过程中做了什么呢？接下来我就简单描述一下</p><p>1.当jvm知道我们要new一个对象以后，会检查这个对象的类是否加载，如果没有，那必须先执行相应的类加载过程</p><p>2.在类加载检查通过后，接下来虚拟机将为新生对象分配内存。对象所需内存的大小在类加载完成后便可完全确定</p><p>3.内存分配完成之后，虚拟机必须将分配到的内存空间(但不包括对象头)都初始化为零值</p><p>4.接下来，Java虛拟机还要对对象进行必要的设置，例如这个对象是哪个类的实例、如何才能找到类的元数据信息、对象的哈希码(实际上对象的哈希码会延后到真正调用0bject::hashCode()方法时才计算) 、对象的GC分代年龄等信息。这些信息存放在对象的对象头(Object Header) 之中。根据虚拟机当前运行状态的不同，如是否启用偏向等，对象头会有不同的设置方式。</p><p>5.在上面工作都完成之后，从虚拟机的视角来看，一个新的对象已经产生了。但是从Java程序的视角看来，对象创建才刚刚开始一构造函数， 即Class文件中的&lt;init&gt; ()方法还没有执行，所有的字段都为默认的零值，对象需要的其他资源和状态信息也还没有按照预定的意图构造好。-般来说(由字节码流中new指令后面是否跟随invokespecial指令所决定，Java编译器会在遇到new关键字的地方同时生成这两条字节码指令，但如果直接通过其他方式产生的则不一定如此)new指令之后会接着执行&lt;init&gt; (方法，按照程序员的意愿对对象进行初始化，这样一个真正可用的对象才算完全被构造出来。</p>\"],\"file\":[\"\"],\"coverImage\":[\"\"],\"typeId\":[\"2\"],\"tags\":[\"2\"],\"status\":[\"1\"],\"description\":[\"对象创建\"],\"keywords\":[\"对象创建\"]}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8085/article/save','http://106.13.33.147:8085/article/update/5','2020-12-22 17:02:05','2020-12-22 17:02:05'),(508,1,'SYSTEM','INFO','用户: [root] | 操作: 进入文章列表页','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8085/articles','http://106.13.33.147:8085/article/update/5','2020-12-22 17:02:09','2020-12-22 17:02:09'),(509,1,'SYSTEM','INFO','用户: [root] | 操作: 修改文章[5]的状态[\"comment\"]','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8085/article/update/comment','http://106.13.33.147:8085/articles','2020-12-22 17:02:15','2020-12-22 17:02:15'),(510,NULL,'VISIT','INFO','访客: [124.74.76.126] | 操作: 进入首页','{}',NULL,'124.74.76.126','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:84.0) Gecko/20100101 Firefox/84.0','Windows 10','Firefox 8','http://106.13.33.147:8443/',NULL,'2020-12-